import React from 'react'
import {MarkerWrapper, Marker} from './styles'


const ProjectMarker = ({project}) => {
    return (
        <MarkerWrapper>
            <Marker />
            <h1>{project.properties.title}</h1>

        </MarkerWrapper>
    )
}

export default ProjectMarker
